import { View, Text, StyleSheet } from 'react-native'
import React from 'react'

export default function Login() {
  return (
    <View style={styles.container}>
         <View style={styles.loginCotainer}>

         </View>
    </View>
  )
}


const styles = StyleSheet.create({
    container:{
     flex:1,
    }
})
